JSON Builders

This module provides Builders that simplify constructing complex `Value`s. This can be useful
when dynamically constructing a `Value`, or when it is inconvenient to write a custom
`Serialize` implementation or to use `#[derive(Serialize)]`.

# Example

```rust
use serde_json::builder::ObjectBuilder;

let value = ObjectBuilder::new()
    .insert("name", "point")
    .insert_array("points", |builder| {
        builder
            .push_object(|builder| {
                builder.insert("x", 1).insert("y", 2)
            })
            .push_object(|builder| {
                builder.insert("x", 3).insert("y", 4)
            })
    })
    .build();
```

JSON Value

This module is centered around the `Value` type, which can represent all possible JSON values.

# Example of use:

```rust
extern crate serde_json;

use serde_json::Value;

fn main() {
    let s = "{\"x\": 1.0, \"y\": 2.0}";
    let value: Value = serde_json::from_str(s).unwrap();
}
```

It is also possible to deserialize from a `Value` type:

```rust
extern crate serde_json;

use serde_json::{Value, Map};

fn main() {
    let mut map = Map::new();
    map.insert(String::from("x"), Value::F64(1.0));
    map.insert(String::from("y"), Value::F64(2.0));
    let value = Value::Object(map);

    let map: Map<String, f64> = serde_json::from_value(value).unwrap();
}
```

Shortcut function to encode a `T` into a JSON `Value`

```rust
use serde_json::to_value;
let val = to_value("foo");
assert_eq!(val.as_str(), Some("foo"))
```
